import Vue from 'vue'
import VueRouter from 'vue-router'
import bank_login from '../views/bank_login.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/login',
    name: 'login',
    component: bank_login
  },

]

const router = new VueRouter({
  routes
})

export default router
